import { Route, Routes } from 'react-router-dom';
import './App.css';
import Navbar from './Navbar';
import Home from './components/Home/home';
import Hostel from './components/HostelPage/Hostel';
import { useContext, useEffect } from 'react';
import {getHostelsData} from './services/api';
import { useDispatch } from 'react-redux';
import { setCurrentCity } from './features/currentCityOrHostel';

function App() {
  const dispatch = useDispatch();
  useEffect(()=>{
    console.log("inside useeffect");
    const res = getHostelsData();
    dispatch(setCurrentCity(res));
    console.log('response is ',res);
  },[]);
  const dataFetching = async () => {
    try {
      const res = await getHostelsData();
      console.log('response is ',res);
    } catch (error) {
      console.log("error while fetching data ", error.message)
    }
  }
  return (
    <div className="App">
        <Navbar/>
        <Routes>
          <Route exact path='/' element={<Home/>}/>
          <Route exact path='/city/:id' element={<Hostel/>}/>
          <Route exact path='/hostel/:id' element={<Hostel/>}/>
        </Routes>
    </div>
  );
}

export default App;
